script: |
  super -f text -I q5688.spq | sort > q5688.out

inputs:
  - name: q5688.spq
    data: |
      SELECT * FROM tab2 (FORMAT parquet) WHERE NOT + - col0 * col0 + + col1 / + col0 BETWEEN col0 + col0 + - 73 + - col2 * col1 * + 86 * - ( - - col1 ) / - + ( - + 62 ) AND NULL;
  - name: tab2

outputs:
  - name: q5688.out
    data: |
      46	51	23
      64	77	40
      75	67	58
